import React from "react"
import estyle from "./Experience.module.scss"
import Main from "../interface/main/Main"
import Secondary from "../interface/secondary/Secondary"

const Experience = () => {

    let mainprops = 
    {
        delay1:5,
        delay2:7,
        duration1: .3,
        duration2: .5,
        color:'teal'
    }

    let secondaryprops =
    {
        delay1:0,
        duration1:.5,
        duration2:.8,
        color:'teal'
    }

    return (
        <div>
            <div className={`${estyle.txt1} ${estyle.space}`}>main bg</div>
            <div className={estyle.container}>
                <div className={estyle.secondlayer}>
                    <Main props={mainprops}/>
                </div>
                <div className={estyle.thirdlayer}>
                    <Secondary props={secondaryprops}/>
                </div>
            </div>
        </div>
    );
};

export default Experience;
